INSERT INTO `publicmateria` VALUES (1,'<p style=\"margin-bottom: 1em; margin-top: 0em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, Geneva, sans-serif; font-size: 14.399999618530273px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21.560001373291016px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(249, 250, 252); \">Este punto de vista es<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://architects.dzone.com/articles/unit-tests-dont-find-bugs\" style=\"text-decoration: none; color: rgb(8, 154, 250); \">el que defiende Shannon Behrens</a><span class=\"Apple-converted-space\">&nbsp;</span>en una entrada en Dzone. Según él, una de las lecciones que ha aprendido haciendo TDD es que<strong>los test no sirven realmente para encontrar bugs</strong>; esto es imposible porque la primera vez que estás escribiendo el código tú no sabes cómo ese código se va a usar, y no vas a ser capaz de crear los test adecuados.</p><p style=\"margin-bottom: 1em; margin-top: 0em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, Geneva, sans-serif; font-size: 14.399999618530273px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21.560001373291016px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(249, 250, 252); \">Shannon describe su experiencia con TDD: al principio hacía muchos test que él consideraba muy buenos, y al final no tenía tiempo ni energía para hacer mucho QA, pero pensaba que no era necesario por los test. Pero después su jefe encontraba un montón de bugs en el código porque lo usaba de formas que él no había previsto.</p>','2012-10-31 18:35:47',NULL,'Los test de unidad no encuentran bugs, sólo encuentran regresiones',31),(2,'<p style=\"margin-bottom: 1em; margin-top: 0em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, Geneva, sans-serif; font-size: 14.399999618530273px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21.560001373291016px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(249, 250, 252); \"><a href=\"http://www.javahispano.org/antiguo_javahispano_org/2011/1/23/nuevo-proyecto-de-eclipse-foundation-orion-platform.html\" style=\"text-decoration: none; color: rgb(8, 154, 250); \">Hace 18 meses Eclipse Foundation anunció Orion Platform</a>. Este proyecto consiste en una<span class=\"Apple-converted-space\">&nbsp;</span><strong>base de código totalmente distinta del Eclipse</strong>&nbsp;IDE de escritorio. Su propósito es construir un<span class=\"Apple-converted-space\">&nbsp;</span><span class=\"caps\">IDE<span class=\"Apple-converted-space\">&nbsp;</span></span>que se ejecute dentro de un navegador web. Se trata de un<span class=\"Apple-converted-space\">&nbsp;</span><span class=\"caps\">IDE<span class=\"Apple-converted-space\">&nbsp;</span></span>con una parte cliente implementada en<span class=\"Apple-converted-space\">&nbsp;</span><span class=\"caps\">HTML<span class=\"Apple-converted-space\">&nbsp;</span></span>y JavaScript y una parte servidor basada en<span class=\"Apple-converted-space\">&nbsp;</span><span class=\"caps\">OSGI</span>y corriendo sobre Jetty. Ahora<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://eclipse.org/orion/\" style=\"text-decoration: none; color: rgb(8, 154, 250); \">acaban de anunciar la versión 1.0</a>, la pridxxmera versión estable.</p><p style=\"margin-bottom: 1em; margin-top: 0em; color: rgb(0, 0, 0); font-family: Arial, Helvetica, Geneva, sans-serif; font-size: 14.399999618530273px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 21.560001373291016px; orphans: 2; text-align: justify; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(249, 250, 252); \">El propósito de Orion es crear un&nbsp;<span class=\"caps\">IDE que&nbsp;</span>se comporte como una aplicación web, y no construir una réplica de cada pieza de funcionalidad de Eclipse en el navegador web. Por ejemplo, distintos archivos o distintas operaciones pueden ser llevadas a cabo en distintas lengüetas del navegador web. Y los enlaces a las distintas partes del<span class=\"Apple-converted-space\">&nbsp;</span><span class=\"caps\">IDE</span>pueden compartirse.</p>','2012-10-31 18:36:47',NULL,'Eclipse Orion 1.0: Eclipse se convierte en una aplicación web',31),(3,'Primera Novedad<br/>','2012-11-06 17:42:10',NULL,'Primer Publicacion',35);
/*!40000 ALTER TABLE `publicmateria` ENABLE KEYS */;
UNLOCK TABLES;

